const Login = () => {
  const navigate = useNavigate();
  const [email, setEmail] = useState("");
  const [code, setcode] = useState("");


    const handleLoginButtonClick =async () => {
      try {
        // Make a request to the authentication endpoint
        const response = await fetch('http://192.168.1.211:5050/api/authenticate', {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json',
          },
          body: JSON.stringify({ email, code }),
          //navigate("admin/user-profile", { state: { code } });
        });

        const data = await response.json();

        if (data.success) {
          // Authentication successful, navigate to the desired page
          navigate("/admin/user-profile",{ state: { code } });
        } else {
          // Authentication failed, handle accordingly
          alert("Wrong Credentials!");
          console.error('Authentication failed:', data.message);
        }
      } catch (error) {
        console.error('Error during login:', error);
        // Handle any unexpected errors
      }
      //old
      //navigate("/admin/user-profile");
    };
  return (
    <>
       <Col lg="5" md="10">
        <Card className="bg-secondary shadow border-0"> 
